domain_model.plantuml:
@startuml
class WetWell {
  +environmentalConditions: string
}

class Liquid {
  +level: number
  +depth: number
}

class Pump {
  +state: string
  +running: boolean
  +availableToRun: boolean
  +runTime: number
  +physicalCondition: string
  +moisture: boolean
  +temperatures: number
  +excessMoisture: boolean
  +sealFailureState: boolean
  +highTemperatureFailureState: boolean
  +leadPumpDepth: number
  +lagPumpDepth: number
}

class Alarm {
  +visual: boolean
  +audible: boolean
  +alarmState: boolean
  +activate()
}

class MoistureSensor {
  +detectSealFailure(): boolean
}

class PumpControlUnit {
  +operationalParameters: object
  +startPump()
  +stopPump()
  +keepTrackOfRunning()
  +keepTrackOfAvailability()
  +shutDownPump()
  +monitorSite()
  +recordParameters()
  +provideAlarm()
  +displayParameters()
}

class LevelSwitch {
  +indicate()
}

class ControlDisplayPanel {
  +digitalDepth: number
  +influent: number
}

class IndicatorLight {
  +enable()
}

class Buzzer {
  +sound()
}

class FloatSwitch {
  +state: string
  +setState()
}

class ElectricalCircuit {
  +broken: boolean
}

class PumpingSite {
}

WetWell *-- Liquid
Pump *-- MoistureSensor
PumpControlUnit -- "1..*" Pump
PumpControlUnit -- Alarm
LevelSwitch "*" -- "1..*" Pump
FloatSwitch -- "1..*" Pump
IndicatorLight "1..*" -- "1..*" Pump
IndicatorLight "1..*" -- WetWell
Alarm -- "1..*" IndicatorLight
Alarm -- Buzzer
@enduml
